import React from 'react';

import ButtonSmall from '../../UserInterface/Buttons/Button/ButtonSmall';
import Button from '../../UserInterface/Buttons/Button/Button';
import Input from '../../UserInterface/Input/Input';


function ConsoleCountRow(props) {

    const flagCountRow = props.flagCountRow;

    return (

        <div className={props.classname}>
            <div>
                <Button
                    onclick={props.onclick}
                    tabindex='-1'
                    name = '1'
                />
                <Button
                    onclick={props.onclick}
                    tabindex='-1'
                    name='1'
                />
                <Button
                    onclick={props.onclick}
                    tabindex='-1'
                    name='1'
                />
            </div>
            
               
            <div>
                {
                    props.flagCountRow ?
                        <Input
                            id="inputCountRow"
                            type="number"
                            label="Строк на странице"
                            onchange={props.onchange}
                            value={props.valueChangeCountRow}
                            tabindex="-1"
                        />
                        : <div> Строк на странице: <span> {props.valueChangeCountRow} </span></div>
                }
            </div>
            {
                props.flagCountRow ?
                    <ButtonSmall
                        className={props.classnameButtonConsoleCountRow}
                        onclick={props.onclickInputSave}
                        tabindex='-1'
                        icon="fa fa-floppy-o"
                    />
                    :<ButtonSmall
                        className={props.classnameButtonConsoleCountRow}
                        onclick={props.onclickInputOpen}
                        tabindex='-1'
                        icon="fa fa-pencil"
                    />
             }

           

            
        </div>

    )
}

export default ConsoleCountRow
